  doInitFn() {
    let params = queryURLParams();
    let binds = [];
    for (let key in params) {
      if (params.hasOwnProperty(key)) {
        if (key.startsWith('bind-')) {
          binds.push({
            id: key.replace('bind-', ''),
            dataId: key.replace('bind-', ''),
            value: params[key]
          });
        }
      }
    }
    if (binds.length) {
      this.setDatas(binds, {
        history: false
      });
    }
  }
